import REturnIcon from './Icon';
import './Box.css';

// Box Main
export default function REturnBoX() {
 return (
  <div className='wrp-box-usr'>

   <REturnIcon icons={<BsWallet size={'1.7em'} />} Text={'Pay or send money'} />
   <REturnIcon icons={<BsCalendar size={'1.7em'} />} Text={'Get the paypal app'} />

  </div>
 );
};
